script: |
  super -f text -I q5266.spq | sort > q5266.out

inputs:
  - name: q5266.spq
    data: |
      SELECT - tab0.col2 + col0 * col2 + + col1 FROM tab0 (FORMAT parquet) WHERE NOT - col1 * + col2 BETWEEN col0 AND ( - col0 + col2 * col0 );
  - name: tab0

outputs:
  - name: q5266.out
    data: |
      131
      7307
      845
